        return (
            <section className="section">
                <div className="table-responsive">
                    <table className="table product-table">
                        <thead>
                            <tr>
                                <th></th>
                                <th>Sản Phẩm</th>
                                <th>Giá</th>
                                <th>Số Lượng</th>
                                <th>Tổng Cộng</th>
                                <th></th>
                            </tr>
                        </thead>
                        <tbody>
                            <Cart>
                                { children }
                            </Cart>
                            <CartResult></CartResult>
                        </tbody>
                    </table>
                </div>
            </section>
        );
    }
}

export default Carts;
